import React from "react";

var menuMakanan = () => {
    return(
        <div style={{border: "1px solid black", width: 300, margin: 'auto'}}>
          <p>Nama Menu : Ayam Bakar</p>
          <p>Harga: Rp. 25.000</p>
        </div>
    )
}

export default menuMakanan
